      const valuePredicate = node => isScalar(node) || isMapping(node) || isSequence(node) || isAlias(node);
      return children.filter(node => excludeKeyPredicate(node) && valuePredicate(node))[0];
    },
    enumerable: true
  }
});
export default YamlKeyValuePair;
